def find_shared_weights(args): original_net = osp.join(args.resource_dir, 'end_to_end_opt.espresso.net')
shared_net = osp.join(args.resource_dir, 'end_to_end_opt_shared.espresso.net') if osp.isfile(shared_net): print('{}: already exists'.format(shared_net)) return
import subprocess
try: cmd = 'espressotool o {} --custom_optimizations find_shared_weights -o {}'.format( original_net, shared_net) subprocess.run(cmd, shell=True, check=True)
# Delete intermediate models to save disk since it is at least 3.1GB cmd2 = 'rm -r {}*'.format(osp.join(args.resource_dir, 'end_to_end.espresso.')) subprocess.run(cmd2, shell=True, check=True)
cmd3 = 'rm -r {}*'.format(osp.join(args.resource_dir, 'end_to_end_opt.espresso.')) subprocess.run(cmd3, shell=True, check=True) except subprocess.CalledProcessError as e: print('{}: {}'.format(type(e).__name__, e)) exit()
